notes:
- Uses OAuth2 with refresh token  requires setup of connected app in api
- Some objects like Contact may return nulls in deeply nested fields
- Windows are floated, resizable, and draggable by default.
- Windows can be maximized to fill the viewport and restored to their prior size.
- The specified HTML element is appended to the layout element of the component after
  any configured HTML has been inserted.
- Floating components do not participate in the Container's layout.
- Ext uses lazy rendering. Child Components will only be rendered should it become
  necessary. Items are automatically laid out when they are first shown (no sizing
  is done while hidden), or in response to a doLayout call.
- Do not specify contentEl or html with items.
- Components directly managed by the BorderLayout layout manager may not be removed
  or added.
- If the Container is already rendered when `add` is called, it will render the newly
  added Component into its content area.
- If the Container was configured with a size-managing layout manager, the Container
  will recalculate its internal layout at this time too.
- The default layout manager simply renders child Components sequentially into the
  content area and thereafter performs no sizing.
- If adding multiple new child Components, pass them as an array to the `add` method,
  so that only one layout recalculation is performed.
- The options object will also be passed as the last argument to every event handler.
